3e\u0432\u0430\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B4%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0421\u0430\u0440\u0434\u0438\u043d\u0441\u043a\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e\">\u0421\u0430\u0440\u0434\u0438\u043d\u0441\u043a\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1742\" class=\"mw-redirect\" title=\"1742\">1742<\/a>&#160;\u2014 \u041e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 \u0431\u043e\u0435\u0432\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u043d\u0430 \u0441\u0443\u0448\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D1%88%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_1741%E2%80%941743\" class=\"mw-redirect\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u0448\u0432\u0435\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 1741\u20141743\">\u043e\u0447\u0435\u0440\u0435\u0434\u043d\u043e\u0439 \u0440\u0443\u0441\u0441\u043a\u043e-\u0448\u0432\u0435\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u0435<\/a>. \u041f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u044b \u043d\u0430\u0447\u0430\u043b\u0438\u0441\u044c \u043b\u0438\u0448\u044c \u0447\u0435\u0440\u0435\u0437 \u0433\u043e\u0434, \u043f\u043e\u0441\u043b\u0435 \u0443\u0441\u043f\u0435\u0448\u043d\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430, \u0438 \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0438\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%BE%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80\" title=\"\u0410\u0431\u043e\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\">\u0410\u0431\u043e\u0441\u043a\u0438\u043c \u043c\u0438\u0440\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1770\" class=\"mw-redirect\" title=\"1770\">1770<\/a>&#160;\u2014 17-\u043b\u0435\u0442\u043d\u0438\u0439 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043f\u043e\u044d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D1%82%D1%82%D0%B5%D1%80%D1%82%D0%BE%D0%BD,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81\" title=\"\u0427\u0430\u0442\u0442\u0435\u0440\u0442\u043e\u043d, \u0422\u043e\u043c\u0430\u0441\">\u0422\u043e\u043c\u0430\u0441 \u0427\u0430\u0442\u0442\u0435\u0440\u0442\u043e\u043d<\/a>, \u043e\u0442\u0447\u0430\u044f\u0432\u0448\u0438\u0441\u044c \u0434\u043e\u0431\u0438\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u044f, \u043e\u0442\u0440\u0430\u0432\u0438\u043b\u0441\u044f, \u043f\u043e\u0441\u043b\u0435 \u0447\u0435\u0433\u043e \u0441\u0440\u0430\u0437\u0443 \u0435\u0433\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0441\u0442\u0430\u043b\u0438 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u041c\u0435\u0436\u0434\u0443 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u043c \u0438 \u0448\u0432\u0435\u0434\u0441\u043a\u0438\u043c \u0444\u043b\u043e\u0442\u043e\u043c \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%BE%D0%B5_%D0%A0%D0%BE%D1%87%D0%B5%D0%BD%D1%81%D0%B0%D0%BB%D1%8C%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041f\u0435\u0440\u0432\u043e\u0435 \u0420\u043e\u0447\u0435\u043d\u0441\u0430\u043b\u044c\u043c\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u043f\u0435\u0440\u0432\u043e\u0435 \u0420\u043e\u0447\u0435\u043d\u0441\u0430\u043b\u044c\u043c\u0441\u043a\u043e\u0435 \