6\u0433\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8B%D0%B9_%D0%B4%D0%BE%D0%BC\" title=\"\u0411\u0435\u043b\u044b\u0439 \u0434\u043e\u043c\">\u0411\u0435\u043b\u044b\u0439 \u0434\u043e\u043c<\/a> \u0432 \u043e\u0442\u043c\u0435\u0441\u0442\u043a\u0443 \u0437\u0430 \u0441\u043e\u0436\u0436\u0435\u043d\u0438\u0435 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0430\u043c\u0438 \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u044b\u0445 \u0437\u0434\u0430\u043d\u0438\u0439 \u0432 \u0419\u043e\u0440\u043a\u0435 (\u043d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D1%80%D0%BE%D0%BD%D1%82%D0%BE\" title=\"\u0422\u043e\u0440\u043e\u043d\u0442\u043e\">\u0422\u043e\u0440\u043e\u043d\u0442\u043e<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1821\" class=\"mw-redirect\" title=\"1821\">1821<\/a>&#160;\u2014 \u041f\u043e \u041a\u043e\u0440\u0434\u043e\u0432\u0441\u043a\u043e\u043c\u0443 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u044f<\/a> \u043f\u0440\u0438\u0437\u043d\u0430\u043b\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1848_%D0%B3%D0%BE%D0%B4\" title=\"1848 \u0433\u043e\u0434\">1848<\/a>&#160;\u2014 \u0432 \u0443\u0441\u0442\u044c\u0435 \u0440\u0435\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%80%D1%81%D0%B8_(%D1%80%D0%B5%D0%BA%D0%B0)\" title=\"\u041c\u0435\u0440\u0441\u0438 (\u0440\u0435\u043a\u0430)\">\u041c\u0435\u0440\u0441\u0438<\/a> \u0441\u0433\u043e\u0440\u0435\u043b \u0430\u043c\u0435\u0440\u0438